    false,nt"url": null,nt"notes": "Water levels and water quality parameters
    recorded on Crane Creek in 2011. LOCATION: Lat. 41u00b037'21.347"N, long 83u00b012'40.758"W,
    near Oak Harbor, OH. Ottawa County, OH on Ottawa National Wildlife Refuge DRAINAGE
    AREA: 36,096 acres PERIOD OF RECORD: Datalogger installed June 2009. Regional Office
    data analysis starts 2009. GAGE SITE JUNE 2009 - MAY 2011 : Sutron Monitor in communication
    with Esterline pressure transducer and YSI water quality. Instruments are powered
    by a 1.2 ampere solar panel run to a deep cycle marine battery through a Sunsaver
    power regulator. Stage is collected at 15-minute intervals. GAGE SITE MAY 2011:
    New logger installed May 20, 2011. Design Analysis 522+ in communication with Esterline
    pressure transducer and YSI water quality probe in a square metal gage house. GOES
    antenna in communication with DA 522+ DCP transmits every hour in a 10 second window
    at a baud rate of 300. Instruments are powered by a 1.2 ampere solar panel run to
    a deep cycle marine battery through a Sunsaver power regulator. Solar panel , GPS
    and GOES antennas are attached to a mast connected to the gage house. Stage is collected
    at 15-minute intervals. Weekly gage height data available online, NWS Id is CRR01.
